DROP DATABASE IF EXISTS hlps5;

CREATE DATABASE hlps5;

GRANT ALL PRIVILEGES ON hlps5.* to grader@localhost IDENTIFIED BY 'allowme';

USE hlps5;

CREATE TABLE Vehicle (
  vid INTEGER,
  model VARCHAR(128),
	maker VARCHAR(128),
  price DOUBLE,
  isrent  BOOLEAN,
  PRIMARY KEY (vid)
);

CREATE TABLE Motorcycle (
	vid INTEGER NOT NULL,
	speed REAL,
  enginecapacity VARCHAR(10),
  color VARCHAR(20),
  PRIMARY KEY (vid),
  FOREIGN KEY (vid) REFERENCES Vehicle (vid) ON DELETE CASCADE
);

CREATE TABLE Tank(
	vid INTEGER NOT NULL,
	speed REAL,
  shell REAL,
  armor REAL,
  PRIMARY KEY (vid),
  FOREIGN KEY (vid) REFERENCES Vehicle (vid) ON DELETE CASCADE
);
CREATE TABLE Car(
	vid  INTEGER NOT NULL,
  type VARCHAR(30),
	fuel VARCHAR(20),
  color VARCHAR(20),
  speed REAL,
  enginecapacity VARCHAR(10),
  PRIMARY KEY (vid),
  FOREIGN KEY (vid) REFERENCES Vehicle (vid) ON DELETE CASCADE
);
CREATE TABLE People (
	pid INTEGER NOT NULL,
  name VARCHAR(30),
  password VARCHAR(128),
  username VARCHAR(30),
  email VARCHAR(256),
  isManager  BOOLEAN,
  telephoneNumber VARCHAR(128),
  PRIMARY KEY (pid)
);
CREATE TABLE Customer (
	pid INTEGER NOT NULL,
  ranking VARCHAR(32),
  PRIMARY KEY (pid),
  FOREIGN KEY (pid) REFERENCES People(pid) ON DELETE CASCADE
);
CREATE TABLE Address(
  pid INTEGER NOT NULL,
  country VARCHAR(256),
  region VARCHAR(256),
  postal VARCHAR(256),
  city VARCHAR(256),
  street VARCHAR(256),
  PRIMARY KEY (pid),
  FOREIGN KEY (pid) REFERENCES People(pid) ON DELETE CASCADE
);
CREATE TABLE Discount (
  ranking VARCHAR(32),
  rate DOUBLE NOT NULL
);

CREATE TABLE Admin (
	pid INTEGER NOT NULL,
  click INTEGER,
  PRIMARY KEY (pid),
  FOREIGN KEY (pid) REFERENCES People(pid) ON DELETE CASCADE
);

CREATE TABLE Duration (
  did INTEGER NOT NULL,
  datefrom INTEGER,
  dateto INTEGER,
  PRIMARY KEY (did)
);
CREATE TABLE Rent (
  vid INTEGER NOT NULL,
	pid INTEGER NOT NULL,
  did INTEGER NOT NULL,
  PRIMARY KEY (vid,pid,did),
  FOREIGN KEY (pid) REFERENCES People(pid) ON DELETE CASCADE,
  FOREIGN KEY (vid) REFERENCES Vehicle (vid) ON DELETE CASCADE,
  FOREIGN KEY (did) REFERENCES Duration (did) ON DELETE CASCADE

);





















